import React from 'react'

const statiscsComps = (props) => {
  return (
    <div>
      <div>
        <img src={props.img} />
      </div>
      <h2>{props.title}</h2>
      <p>{props.paragraph}</p>
    </div>
  )
}

export default statiscsComps
